import React from 'react';
import Hero from './Hero';
import Products from './Products';

const Main = (props) => {

    const { foodList, isOpen } = props;

    return (
        <main className="app__main">
            <Hero
            />
            {isOpen ? 
            <Products
            foodList={ foodList }
            />
            :
            ''
        }
        </main>
    );
}

export default Main;
